import React, { Component } from 'react';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import {Nav,Navbar,NavDropdown,Form,FormControl,Button} from 'react-bootstrap';

import MenuIcon from '@material-ui/icons/Menu';
import { IconButton,} from '@material-ui/core';


class NavbarComps extends Component {

    menuState={
        anchorEl:null,
        setAnchorEl:null
    }

   handleClick = (event) => {
       this.setState({ setAnchorEl:event.currentTarget});
      };
    
     handleClose = () => {

        this.setState({ setAnchorEl:null});
      };

    render() {
        return (
            <div>
        <Navbar  bg="light" expand="lg">
                <Navbar.Brand  href="#home">EGBA SİSTEM</Navbar.Brand>
                 <Form style={{marginLeft:650,marginRight:50}}inline>
         <FormControl type="text" placeholder="Search" className="mr-sm-2" />
         <Button variant="outline-info">Search</Button>
       </Form>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse   id="basic-navbar-nav">
        <Nav  className="mr-auto">
        
        <Nav.Link style={{marginLeft:550,marginRight:25}} href="#home" >Home</Nav.Link>
     
        <NavDropdown  title="EDC" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Çıkış Yap</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    
  </Navbar.Collapse>
</Navbar>
                
                    
                    
                
            </div>
        )
    }
}
export default NavbarComps;
